    while True:
        cnt += r * pow(10, r - 1) * 9
        if cnt >= n:
            break
        r += 1
    cnt -= r * pow(10, r - 1) * 9
    n -= cnt
    (q, rem) = divmod(n, r)
    num = q + pow(10, r - 1) - 1
    if rem == 0:
        return num * 10
    else:
        num += 1
        ans = str(num)
        return int(ans[rem - 1])

